import React, { useState } from 'react';
import { View, Text, TouchableOpacity, StyleSheet, ScrollView, TextInput } from 'react-native';
import { LineChart } from 'react-native-chart-kit';
import { Dimensions } from 'react-native';

const ProfileScreen = () => {
  const [report, setReport] = useState('');
  const [reports, setReports] = useState([]);
  const [editIndex, setEditIndex] = useState(null);
  const [attendanceData, setAttendanceData] = useState([
    { date: '09/01', value: 75 },
    { date: '09/02', value: 80 },
    { date: '09/03', value: 85 },
    // Add more data points as needed
  ]);

  // Replace these with your dynamic data or placeholders
  const name = 'John Doe';
  const role = 'Teacher';
  const location = 'New York';
  const zipCode = '10001';
  const email = 'john.doe@example.com';
  const phone = '+1 (123) 456-7890';

  const handleAddReport = () => {
    if (report.trim() !== '') {
      if (editIndex !== null) {
        const updatedReports = [...reports];
        updatedReports[editIndex] = report;
        setReports(updatedReports);
        setEditIndex(null);
      } else {
        setReports([...reports, report]);
      }
      setReport('');
    }
  };

  const handleEditReport = (index) => {
    setReport(reports[index]);
    setEditIndex(index);
  };

  const handleDeleteReport = (index) => {
    const updatedReports = [...reports];
    updatedReports.splice(index, 1);
    setReports(updatedReports);
  };

  return (
    <ScrollView contentContainerStyle={styles.container}>
      <TouchableOpacity style={styles.circularShape}>
        <Text style={styles.initials}>{name.charAt(0)}</Text>
      </TouchableOpacity>

      <View style={styles.infoContainer}>
        <Text style={styles.name}>{name}</Text>
        <Text style={styles.label}>{role}</Text>
        <Text style={styles.location}>Location: {location}</Text>
        <Text style={styles.zip}>ZIP Code: {zipCode}</Text>
        <Text style={styles.email}>{email}</Text>
        <Text style={styles.phone}>Phone: {phone}</Text>
      </View>

      <View style={styles.reportContainer}>
        <Text style={styles.reportLabel}>Report:</Text>
        <TextInput
          style={styles.reportInput}
          multiline
          placeholder="Write a report..."
          value={report}
          onChangeText={(text) => setReport(text)}
        />
        <TouchableOpacity style={styles.addButton} onPress={handleAddReport}>
          <Text style={styles.addButtonText}>
            {editIndex !== null ? 'Update Report' : 'Add Report'}
          </Text>
        </TouchableOpacity>
      </View>

      {/* Display Reports */}
      <View style={styles.reportsContainer}>
        <Text style={styles.reportsLabel}>Reports:</Text>
        {reports.map((item, index) => (
          <View key={index} style={styles.reportItem}>
            <Text style={styles.reportText}>{item}</Text>
            <TouchableOpacity
              style={styles.editButton}
              onPress={() => handleEditReport(index)}
            >
              <Text style={styles.editButtonText}>Edit</Text>
            </TouchableOpacity>
            <TouchableOpacity
              style={styles.deleteButton}
              onPress={() => handleDeleteReport(index)}
            >
              <Text style={styles.deleteButtonText}>Delete</Text>
            </TouchableOpacity>
          </View>
        ))}
      </View>

      {/* Display Attendance Chart */}
      <View style={styles.chartContainer}>
        <Text style={styles.chartLabel}>Attendance Chart:</Text>
        <LineChart
          data={{
            labels: attendanceData.map((dataPoint) => dataPoint.date),
            datasets: [
              {
                data: attendanceData.map((dataPoint) => dataPoint.value),
              },
            ],
          }}
          width={Dimensions.get('window').width - 40} // Adjust width as needed
          height={200}
          yAxisSuffix="%"
          chartConfig={{
            backgroundGradientFrom: 'white',
            backgroundGradientTo: 'white',
            decimalPlaces: 0,
            color: (opacity = 1) => `rgba(69, 138, 10, ${opacity})`,
            labelColor: () => 'gray',
            propsForDots: {
              r: '6',
              strokeWidth: '2',
            },
          }}
          style={{ marginTop: 20 }}
        />
      </View>
    </ScrollView>
  );
};

const styles = StyleSheet.create({
  // ...your existing styles...

  chartContainer: {
    alignSelf: 'stretch',
    paddingHorizontal: 20,
    marginTop: 20,
  },
  chartLabel: {
    fontSize: 20,
    fontWeight: 'bold',
  },
});

export default ProfileScreen;
